### Group dead key introduction
#
#   The group dead key is a special dead key designed to remap every single key
#   position. E.g. group 1 of ∆Ü…î, √ë√± and non-breaking hyphen outputs "‚Äï" U2015,
#   a feature designed for African, Breton, and remapped variants.
#   See #*# GROUP_1
#
#   Usually, however, the scope of the group dead key is limited to a handy set
#   of characters including the Latin base alphabet, the ten digits and the set
#   of ASCII symbols mapped on level 3 as of 30 symbols, and level 1 for period
#   and comma, plus the space bar, with ordinary space and no-break space used.
#
#   The resulting letter groups and symbol groups make up the main content of a
#   standard group dead key as used on this keyboard layout, with support for a
#   minimum number of 4 multiple presses. Support for looping through the group
#   array is straightforward on macOS with the terminator showing the currently
#   active group, and on Windows. In XCompose, supporting the first four groups
#   by multiple presses is feasible, and going beyond is not even desirable, as
#   all groups ‚Äî except group 1 and group 2 ‚Äî are activatable by typing a digit
#   after pressing the group dead key. This scheme expands the group array to a
#   total number of 12 groups accessed using the group dead key, piling up upon
#   the default group, that is obiously numbered 0, contrasting with the scheme
#   introduced by ISO/IEC 9995.
#
#   Digits and non-ASCII base characters:
#   See #*# GROUP_1
#   and following, up to #^# GROUP_12
#
#   ASCII symbols and punctuation, space, no-break space:
#   See ### Space and symbol groups
#
#   Latin base alphabet:
#   See ### Letter groups
#
#   The keysym *dead_group is not supported in keysymdef.h. For the time being,
#   the private use character UEFB0 is used as the group dead key.
#
#
# # History
#
#   The group dead key has been introduced by Karl Pentzlin during the
#   implementation of the new DIN 2137-2:2012 standard on Windows. Noticing the
#   lack of support for the ISO/IEC 9995 style group dead key in TSF, the Text
#   Services Framework on Windows, Karl Pentzlin moved the group dead key to a
#   real dead key taking over the dead key behavior that ISO/IEC 9995 specified
#   on the level 2 + level 3 modifier combination. A similar dead key included
#   in other keyboard layouts may be called ‚ÄúLatin and punctuation‚Äù as on the
#   French ergonomic b√©po keyboard layout, or ‚ÄúEurope‚Äù as in NF Z71-300:2019.
#   https://bepo.fr/wiki/Latin_et_ponctuation
#
#   XKB supports the ISO/IEC 9995 conformant group selection since 2013, see
#   https://bugs.freedesktop.org/show_bug.cgi?id=60991
#
#   But XKB keysym mapping is limited to a maximum number of 8 elements. This
#   array is used up by the extra graphic modifier required for the support of
#   input methods for the Unicode conformant digital representation of numbers
#   and measurement units used in 50+ countries, conforming to the guidelines
#   set up by the Bureau International des Poids et Mesures BIPM, and for input
#   of French, that uses U202F NARROW NO-BREAK SPACE to space out a number of
#   punctuation marks following the French Imprimerie Nationale and/or French
#   new-school typesetting as documented in points (2) and (3) of:
#   https://forums.macg.co/threads/typo-caracteres-capitales-accentues.25739/page-5#post-3151119
#
#   Virtual dead keys accessed by multiple dead key presses in turn have been
#   introduced by the b√©po development team in 2015, while upgrading the b√©po
#   layout to version 1.1 for the NF Z71-300:2019 keyboard layout standard.
#
#
# # Numbering
#
#   For UX consistency, the default group is group 0. Therefore, the numbering
#   scheme specified in ISO/IEC 9995 is ruled out in favor of a zero-based one.
#   Only groups accessed by the group dead key are numbered starting
#   with 1, because a group accessed by an n-uple press on the group dead key
#   must be called ‚Äúgroup n‚Äù rather than ‚Äúgroup n+1‚Äù. The ISO/IEC 9995 standard
#   uses 1-based numbering because it uses the terms ‚Äúprimary‚Äù and ‚Äúsecondary‚Äù
#   with respect to groups and fails to consider dead key based group selection
#   with support for multiple presses.
#
#   As a short identifier for "group #", "g#" is proposed.
#
#
# # Cross-platform compatibility
#
#   Implementing the group selector as a dead key rather than a modifier key
#   avoids breaking user experience across platforms, since Windows unsupports
#   the ISO group selector modifier key combination Shift + AltGr, but supports
#   6 + 1 modifiers, and Apple has broken its technote TN2056 around 2015 after
#   previously allowing to use left Option as an extra modifier, that was
#   effectively used by the German Neo ergonomic keyboard layout. After the
#   dedicated left Option was broken, Neo emulated left Option using
#   Takayama Fumihiko‚Äôs Karabiner Elements.
#   https://pqrs.org/osx/karabiner/
#
#
# # Maintenance
#
#   Filling empty slots with null output "" U0000 can be avoided. The "" U0000
#   strings have been removed for ease of maintenance on 2023-01-13T1356+0100.
#   See # # Notes for maintenance
#
#
#
### Space and symbol groups
#
#   The base characters in this section are mapped on AltGr/Option or unshifted
#   keys as of comma, period and space. Symbols and punctuation mapped on level
#   three assume using the group dead key in synergy on AltGr/Option.
#
#   Consistently this section is ordered by keys rather than by code points, as
#   the order of the ASCII symbols on the keyboard layout is used for mnemonics
#   in synergy with the learning curve required by using the base alphabet as a
#   means to remember the symbols, not meant to be printed on physical keycaps.
#
#
# # Math symbols in symbol groups
#
#   Mathematical symbols outside the math section, i.e. in the dead key section
#   and especially in the symbol groups, are labeled as "math" since this label
#   is converted into link text, with a hyperlink to the first instance of that
#   symbol on the math symbols page, on the condition that the "math" string is
#   appended as the very last element.
#
#   Non-math characters, such as the letter pi and the envelope emoji, are also
#   given this "math" label, as far as a multikey sequence in the math section
#   is available for input. This "math" label is therefore more of a UX feature
#   than of an information about the `Math` status. In this regard, this "math"
#   label is the opposite of the `Sm` General Category, discussed at the start
#   of the math section.
#   See ### Mathematical symbols by multikey
#
#
# # Emoji in symbol groups
#
#   Supporting all emoji in the Basic Multilingual Plane except Chinese letter
#   emoji makes sense because input by dead keys is cross-platform compatible,
#   whereas SMP emoji are excluded from this scheme because of cross-platform
#   incompatibilities due to design mistakes in Windows, where keyboard layouts
#   have been coded by a single developer whose errors persistently degraded
#   the usability of most of the world‚Äôs computers.
#
#   A number of BMP emoji are supported alternatively or only elsewhere:
#
#       * See #^# Abbreviations, Units and Legal Symbols
#       * See #^# Western Zodiacal Signs
#       * See #^# Emoji by multikey
#       * See # # Arrow emoji
#
#   A number of Supplemental Multilingual Plane emoji are mapped on live keys.
#
#   The two emoji-related variation selectors are in group 10 on key E, D03,
#   for emoji style, VS16 UFE0F, and on key T, D05, for text style, VS15 UFE0E.
#
#   The five emoji skin tone modifiers based on the 6-shades Fitzpatrick scale
#   "üèª" U1F3FB, "üèº" U1F3FC, "üèΩ" U1F3FD, "üèæ" U1F3FE, "üèø" U1F3FF are discontinued
#   as inappropriate on a general-purpose keyboard layout without extensive
#   emoji support.
#
#   Emoji full list:
#   https://unicode.org/emoji/charts/full-emoji-list.html
#   https://www.unicode.org/emoji/charts-15.1/emoji-list.html
#
#   The source list:
