#
#
# # A03-level1 space
#
#   ISO A03 should be the left Thumb Shift (Oyayubi Shifuto).
#   https://web.stanford.edu/class/cs140/projects/pintos/specs/kbd/scancodes-7.html
#
#   U200B ZERO WIDTH SPACE has an alternate, more intuitive and more familiar
#   acronym: WNJ, for WORD NON-JOINER.
#   https://unicode-org.atlassian.net/browse/CLDR-16631?focusedCommentId=169819
#   https://www.unicode.org/mail-arch/unicode-ml/y2007-m11/0119.html
#   https://github.com/unicode-org/cldr/blob/2b08423c8502f499b334eef17488c730adcd3a6c/tools/cldr-code/src/main/java/org/unicode/cldr/util/CodePointEscaper.java#L32
#   https://github.com/unicode-org/cldr/blob/main/tools/cldr-code/src/main/java/org/unicode/cldr/util/CodePointEscaper.java#L32
#
#   U200B ZERO WIDTH SPACE also has an intuitive, to-the-point French name:
#   C√âSURE CONDITIONNELLE, break opportunity, non-existent in English.
#
#   The WNJ is also on live key, level 4 of the space bar, for its use in long
#   URLs expected to line-wrap after slashes but not doing so in browsers that
#   are not fully Unicode conformant, and because level 4 of the space bar must
#   not be used for frequent space characters like U00A0 NBSP and U202F NBTSP.
#   https://www.unicode.org/versions/Unicode15.0.0/UnicodeStandard-15.0.pdf#page=944
#   https://unicode.org/reports/tr14/#SY
#
#   U2002 and U2003 are on level 1 for usability, although these spaces were
#   originally intended to be no-break. That brings the need to move their two
#   breaking clones to level3, since these have become canonically equivalent.
#   U2002..U2006 and U2008..U200A were originally intended to be no-break, just
#   like U2007 FIGURE SPACE ultimately remained, as sort of the sole survivor.
#
#   Unlike stated in UAX #14, U2007 is not intended for use *in* figures,
#   but *before* figures for indentation in tables. Therefore, it is also
#   called tabular digit space, as opposed to the tabular punctuation space
#   U2008.
#   https://www.unicode.org/reports/tr14
#
#   U205F MEDIUM MATHEMATICAL SPACE is a breaking 4/18 em, or 4¬Ω-per-em.
#
#   U3000 IDEOGRAPHIC SPACE does not hang into the margin.
#
